import React, {useState} from 'react';
// import "./index.css";

const App = () => {
  const [item, setItems] = useState("");

  const InputEvent =(e)=>{
    setItems(e.target.value)
  }
  
  return (
    <>
       <h2>ToDo List</h2>
       <input type="text" 
         onChange={InputEvent}
         value={item}
       />
       <span><i class="fas fa-plus-circle" onClick={clickE}></i></span>
       <br />
       <br />
       <ol>
     
         <li>  <span><i class="fas fa-trash"></i></span>{item}</li>
       </ol>
          
    </>
  )
}

export default App;
